-- a4_ferry_data.sql
-- CSC 106 - Fall 2017
--
-- Construct a database containing data on BC ferries departures
-- and arrivals for August - October 2017.
--
-- The data was all automatically collected from the BC Ferries website.
--
-- B. Bird - 11/05/2017


drop table if exists fleet;
drop table if exists routes;
drop table if exists sailings;

create table fleet( vessel_name text primary key, 
                    year_built integer,
                    place_built text,
                    length_metres real,
                    displacement_tonnes real,
                    car_capacity integer,
                    human_capacity integer,
                    maximum_speed_knots real,
                    horsepower real );

create table routes( route_number int primary key,
                     port1 text,
					 port2 text,
					 nominal_duration int -- Normal duration (in minutes) of this route
				   );
create table sailings( route_number int,
                       source_port text,
					   destination_port text,
					   year int,
					   month int,
					   day int,
					   departure_hour int,
					   departure_minute int,
					   vessel_name text,
					   duration int, -- Duration (in minutes) of the sailing
					   status text, -- A string of text describing the sailing status (e.g. 'On time' or 'Operational Delay')
					   
					   -- The next three lines are "key" definitions which improve performance (not part of CSC 106)
					   primary key (year,month,day,source_port,destination_port,departure_hour,departure_minute),
					   foreign key (route_number) references routes(route_number),
					   foreign key (vessel_name) references fleet(vessel_name)
					 );
					 
                    



